import React from "react";
import 'antd/dist/antd.css';
import Head from 'next/head';

const Passionary = ({Component}) => {

    return(
        <>
        <Head>
            <meta charSet="utf-8"/>
            <title>Passionary</title>
        </Head>
        <Component />
        </>
    );

};
//_app.js는 pages들의 공통 부분
export default Passionary;
